INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("フリーマーケット会場", 40, "青空の下で謁見", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "ペコリーヌとの出会い", 1, 10118, 2834, 7, 2, 5118061, 0, 91002, 8, 0);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("フリーマーケット会場", 40, "未来の騎空団\nマスコット？", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "マホとの出会い", 1, 10118, 2835, 7, 2, 5118062, 0, 91002, 8, 0);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("ランドソル市街地", 40, "お嬢さまからの\n緊急依頼", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "アキノとの出会い", 1, 10118, 2837, 7, 2, 5118063, 0, 91002, 8, 0);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("フリーマーケット会場", 40, "黄金色の悩みごと", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "ジュンとの出会い", 1, 10118, 4108402, 18, 2, 5118064, 0, 91002, 8, 0);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("フリーマーケット会場", 40, "白熱！　格闘大会！", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "カオリとの出会い", 1, 10118, 4107402, 18, 2, 5118065, 0, 91002, 8, 0);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("オーエド町", 40, "祭り太鼓はオーエドの華", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "ニノンとの出会い", 1, 10118, 9000227, 16, 2, 5118066, 1, 91002, 8, 0);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("フリーマーケット会場", 40, "人気者は遅れて\nやってくる", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "スズナとの出会い", 1, 10118, 2101181, 19, 3, 5118067, 0, 91002, 8, 0);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("ランドソル市街地", 40, "巫女・ミーツ・魔法少女", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "ナナカとの出会い", 1, 10118, 4109402, 18, 3, 5118068, 0, 91002, 8, 0);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("フリーマーケット会場", 40, "ネズ耳は二度なくなる", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "キャル＆コッコロとの出会い", 1, 10118, 4305402, 18, 3, 5118069, 0, 91002, 8, 0);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("ランドソル市街地", 40, "この出会いにカンパイ！", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "ユカリとの出会い", 1, 10118, 4101402, 18, 3, 5118070, 0, 91002, 8, 0);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("ランドソル市街地", 40, "陰陽アンサンブル", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "アオイとの出会い", 1, 10118, 4106402, 18, 3, 5118071, 0, 91002, 8, 0);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("フリーマーケット会場", 40, "運試し十番勝負！", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "シノブとの出会い", 1, 10118, 2836, 7, 3, 5118072, 1, 91002, 8, 0);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (0, 0, "彼女たちの新たな日常", 0, "オープニング", 0, 10118, 0, 0, 1, 5118600, 0, 0, 0, 10145115);
